// OnlineDelivery.js
// Detailed page for online services and delivery.

import React from 'react';
import { Link } from 'react-router-dom';

const OnlineDelivery = () => {
  return (
    <div className="service-page">
      <h1>Онлайн‑услуги и доставка</h1>
      <img
        src={process.env.PUBLIC_URL + '/img/qr.png'}
        alt="Онлайн‑услуги и доставка"
        className="service-page__image"
      />
      <p>
        Вам не нужно приезжать в офис. Отправляйте файлы онлайн, оплачивайте
        заказ любым удобным способом и получите готовую продукцию с
        доставкой по городу. Мы заботимся о вашем времени и удобстве.
      </p>
      <p><strong>Стоимость:</strong> зависит от объёма заказа и адреса доставки.</p>
      <p><strong>Срок исполнения:</strong> от 1 дня.</p>
      <Link to="/services" className="btn btn-primary">
        Вернуться к услугам
      </Link>
    </div>
  );
};

export default OnlineDelivery;
